import React, { useState, useEffect } from 'react';
import { getAllBookings, deleteBooking } from '../services/BookingService';

const BookingList = ({ onSelectBooking, onEditBooking }) => {
    const [bookings, setBookings] = useState([]);

    useEffect(() => {
        loadBookings();
    }, []);

    const loadBookings = async () => {
        const response = await getAllBookings();
        setBookings(response.data);
    };

    const handleDelete = async (id) => {
        await deleteBooking(id);
        loadBookings();
    };

    return (
        <div>
            <h2>Booking List</h2>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Date</th>
                        <th>Duration</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {bookings.map((booking) => (
                        <tr key={booking.bookingId}>
                            <td>{booking.bookingId}</td>
                            <td>{booking.bookingDate}</td>
                            <td>{booking.duration}</td>
                            <td>
                                <button onClick={() => onSelectBooking(booking)}>View</button>
                                <button onClick={() => onEditBooking(booking)}>Edit</button>
                                <button onClick={() => handleDelete(booking.bookingId)}>Delete</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default BookingList;
